(53, 1, '2019-11-30 03:40:13', '2019-11-30 03:40:13', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McCtock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero.\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<div class=\"chopcafe_product_tab woocommerce_tabs\">\r\n<div class=\"tab-content\">\r\n<div id=\"product_discription\" class=\"tab-pane active\">\r\n<ul>\r\n 	<li>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</li>\r\n 	<li>Morbi eu risus fringilla, auctor nibh nec, pharetra libero.</li>\r\n 	<li>Cras id tortor et sem scelerisque facilisis.</li>\r\n 	<li>Maecenas ultrices urna et iaculis efficitur.</li>\r\n 	<li>Vivamus vel metus efficitur, rutrum augue vitae, vestibulum ipsum.</li>\r\n 	<li>Ut sit amet lacus sed mi luctus suscipit.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"chopcafe_grid_shop row\">\r\n<div class=\"col-lg-12\">\r\n<div class=\"releted_menu\"></div>\r\n</div>\r\n</div>\r\n&nbsp;', 'Chicken Breast', '', 'publish', 'open', 'closed', '', 'chicken-breast', '', '', '2020-10-11 11:54:23', '2020-10-11 04:54:23', '', 0, 'http://localhost/cuisine/?post_type=product&#038;p=53', 0, 'product', '', 1),
