(160, 1, '2020-10-11 20:23:54', '2020-10-11 13:23:54', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McCtock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero.\n<div class=\"row\">\n<div class=\"col-lg-12\">\n<div class=\"chopcafe_product_tab woocommerce_tabs\">\n<div class=\"tab-content\">\n<div id=\"product_discription\" class=\"tab-pane active\">\n<ul>\n 	<li>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</li>\n 	<li>Morbi eu risus fringilla, auctor nibh nec, pharetra libero.</li>\n 	<li>Cras id tortor et sem scelerisque facilisis.</li>\n 	<li>Maecenas ultrices urna et iaculis efficitur.</li>\n 	<li>Vivamus vel metus efficitur, rutrum augue vitae, vestibulum ipsum.</li>\n 	<li>Ut sit amet lacus sed mi luctus suscipit.</li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"chopcafe_grid_shop row\">\n<div class=\"col-lg-12\">\n<div class=\"releted_menu\"></div>\n</div>\n</div>\n&nbsp;', 'Chicken Breast', '<p><br data-mce-bogus=\"1\"></p>', 'inherit', 'closed', 'closed', '', '53-autosave-v1', '', '', '2020-10-11 20:23:54', '2020-10-11 13:23:54', '', 53, 'http://localhost/cuisine/53-autosave-v1/', 0, 'revision', '', 0),
